DROP TABLE IF EXISTS "Store" CASCADE;
DROP TABLE IF EXISTS "Customer" CASCADE;
DROP TABLE IF EXISTS "Product" CASCADE;
DROP TABLE IF EXISTS "Inventory" CASCADE;
DROP TABLE IF EXISTS "Order" CASCADE;
DROP TABLE IF EXISTS "OrderDetail" CASCADE;
DROP TABLE IF EXISTS "Promotion" CASCADE;

CREATE TABLE "Store" (
	"id" integer NOT NULL,
	"phone" text NOT NULL,
	"addressLine1" text NOT NULL,
	"addressLine2" text DEFAULT NULL,
	"city" text NOT NULL,
	"state" text NOT NULL,
	"postalCode" text NOT NULL,
	"country" text DEFAULT 'USA',
	PRIMARY KEY ( "id" )
 );

CREATE TABLE "Customer" (
	"id" integer NOT NULL,
	"name" text NOT NULL,
	"phone" text NOT NULL,
	"addressLine1" text NOT NULL,
	"addressLine2" text DEFAULT NULL,
	"city" text NOT NULL,
	"state" text NOT NULL,
	"postalCode" text NOT NULL,
	"country" text DEFAULT 'USA',
	"creditLimit" integer DEFAULT 0,
	"storeId" integer DEFAULT NULL,
	PRIMARY KEY ( "id" ),
	CONSTRAINT "customer_store_fk" FOREIGN KEY ( "storeId" ) REFERENCES "Store" ( "id" )
);

CREATE TABLE "Product" (
	"id" integer NOT NULL,
	"productName" text NOT NULL,
	"productSize" text NOT NULL,
	"productVendor" text NOT NULL,
	"productDescription" text NOT NULL,
	"buyPrice" numeric(6,2) NOT NULL,
	"msrp" numeric(6,2) NOT NULL,
	"departmentCode" integer NOT NULL,
	PRIMARY KEY ( "id" )
);

CREATE TABLE "Inventory" (
	"storeId" integer NOT NULL,
	"productId" integer NOT NULL,
	"quantity" integer NOT NULL,
	PRIMARY KEY ( "storeId", "productId" ),
	CONSTRAINT "inventory_store_fk" FOREIGN KEY ( "storeId" ) REFERENCES "Store" ( "id" ),
	CONSTRAINT "inventory_product_fk" FOREIGN KEY ( "productId" ) REFERENCES "Product" ( "id" )
);

CREATE TABLE "Order" (
	"id" integer NOT NULL,
	"customerId" integer NOT NULL,
	"orderDate" date NOT NULL,
	"comments" text DEFAULT NULL,
	PRIMARY KEY ( "id" ),
	CONSTRAINT "orders_customer_fk" FOREIGN KEY ( "customerId" ) REFERENCES "Customer" ( "id" )
);

CREATE TABLE "OrderDetail" (
	"orderId" integer NOT NULL,
	"productId" integer NOT NULL,
	"quantityOrdered" integer NOT NULL,
	"msrp" numeric(6,2) NOT NULL,
	"discount" integer NOT NULL,
	PRIMARY KEY ( "orderId", "productId" ),
	CONSTRAINT "orderdetails_product_fk" FOREIGN KEY ( "productId" ) REFERENCES "Product" ( "id" ),
	CONSTRAINT "orderdetails_order_fk" FOREIGN KEY ( "orderId" ) REFERENCES "Order" ( "id" )
);

CREATE TABLE "Promotion" (
	"id" integer NOT NULL,
	"productId" integer NOT NULL,
	"discount" integer NOT NULL,
	PRIMARY KEY ( "id", "productId" ),
	CONSTRAINT "orderdetails_product_fk" FOREIGN KEY ( "productId" ) REFERENCES "Product" ( "id" )
);


